import React from "react";
import "./Filter.css";
const Filter = () => {
    const FilterElement = ['All', 'Javascript','PHP',"React","Cartoon","Amazing","Great","Commedy","Awesome","Angular","Node","Next"];
    
  return (
    <div className="Filter d__flex align__items__center">
      <div className="Filter__container d__flex ">
      {
        FilterElement.map((element)=>(
            <div className="Filter_item pointer mx-5">
                <span>{element}</span>
            </div>
        ))
    }

          
      </div>
    </div>
  );
};

export default Filter;
